import React from 'react';
import './App.css';

function Cart() {
  return (
    <div className="cart-section">
      <div className="section-header">
        <h2>Your Cart</h2>
        <p>Review the laptops you've selected before checking out.</p>
      </div>

      <div className="container">
        <p>Your cart is currently empty.</p>
      </div>
    </div>
  );
}

export default Cart;
